import React from 'react';
import styled from 'styled-components';
// import logo from '../assets/images/tripsoda_icon.png';
import MyComponent from '../component/te2';

export default function Result({ location }) {
    // console.log(location.state.list);
    
    let tatste = 0; // 취향
    let interest = 0; // 관심사

    let cnt = 0;
    for( let num of location.state.list){
        if(cnt < 5) 
            tatste = tatste + num;
        else if(cnt > 4)
            interest = interest + num;

        cnt++;
    }

    console.log(tatste);
    console.log(interest);
    
    let re = [tatste,interest];

    // 배열에 결과값 넣어서 te2에 넣고
    // te2에서 리턴을 해주고
    // 아래에서 그대로 사용. 

    return (
        
        <div className='App'>
            <MyComponent />
            
        </div>
        // <div>결과</div>
    // <ConsultStyled>

        // <div className="logo">
        //     <img src={logo}/>
        // </div>
    // </ConsultStyled>
)

};
const ConsultStyled = styled.div`
    max-width: 752px;
    margin: 0 auto;
    width: 100%;
    box-sizing: border-box;
    padding: 0 10px;


    .logo {
        display: flex;
        justify-content: center;
        padding-top: 30px;
    }
`;
